import React, { useEffect, useState } from "react";
import axios from "axios";
function Kamkala() {
  const [set, seturl] = useState([]);
  const [set1, seturl1] = useState({});
  const apicheck = async () => {
    try {
      const result = await axios.get("http://192.168.29.3:8001/getFiles");

      if (result.status) {
        // console.log(`http://192.168.29.3:8001/upload/art-gallery-owner/${result.data.data[0].files[0].file_name}`)

        seturl(result.data.data[0].files[0].files);
        // console.log(result.data.data[0].files[0].files.map((d, i) => d));
        seturl1(
          `http://192.168.29.3:8001/upload/${result.data.data[0].folder}/`
        );
        // console.log(result.data.data[0].files);
        // console.log(
        //   `http://192.168.29.3:8001/upload/${result.data.data[0].folder}/`
        // );
      } else {
      }
    } catch (error) {}
  };

  useEffect(() => {
    apicheck();
  }, []);

  // const a = set1 + set;
  // console.log(a);
  return (
    <div id="Kamkala">
      <>
        <div
          className="md:mt-40 mt-20 mx-auto container p-5"
          // data-aos="fade-up"
          // data-aos-duration="2000"
        >
          <p className="font-Josefin_Sans font-bold xl:text-6xl md:text-5xl text-4xl  text-center text-[#374C9F]">
            NFT Collections
          </p>

          <div className="font-Roboto gap-12   flex justify-center flex-wrap">
            {set.map((items, key) => (
              <div className="hover:bg-opacity-50 rounded-lg  mt-16 ">
                <div
                  className="flex items-center justify-center  flex-col  transition ease-in-out delay-150  "
                  // data-aos="fade-up"
                  // data-aos-duration="3000"
                >
                  <p>{items.file_name}</p>
                  {console.log(items.file_name)}
                  {/* <img src={a} alt="Bonnie image" /> */}
                </div>
              </div>
            ))}
          </div>
        </div>
      </>
    </div>
  );
}

export default Kamkala;
